import Layout from './components/myLayoutAfter';
import './util/config'
import './css/app.css'
import { useRouter } from 'next/router';



const Home = () =>{
  const router = useRouter()
  const query = router.query
  console.log(query)

    return(
      <div>
        <Layout userInfo = {query}/>
          <p>
              Welcome to women in Australia website!<br />
              Our purpose is share more outstanding women archive in Australia!
          </p>
      </div>
      
    );
}
export default Home;
